const AuthModal = ({ setShowModal }) => {

    const handleClick = () => {
        setShowModal(false);
    }

    const isSignUp = true;

    return (
        <div className="auth-modal">
            <div onClick={handleClick}><span className="close-icon">&#11198;</span></div>
            <h2>{isSignUp ? "CREATE ACCOUNT" : "LOG IN"}</h2>
            <p>By clicking <span>Log in</span>, you agree to our <a href="https://policies.tinder.com/terms?lang=en" target="_blank" data-testid="termsOfService" rel="noopener noreferrer" aria-describedby="open-in-new-window">Terms</a>. Learn how we process your data in our <a class="C($c-secondary) focus-outline-style Fw($fw-ds-bold) Td(u) Td(n):h" href="https://policies.tinder.com/privacy?lang=en" target="_blank" data-testid="privacyPolicy" rel="noopener noreferrer" aria-describedby="open-in-new-window">Privacy Policy</a> and <a class="C($c-secondary) focus-outline-style Fw($fw-ds-bold) Td(u) Td(n):h" href="https://policies.tinder.com/cookie-policy?lang=en" target="_blank" data-testid="cookiePolicy" rel="noopener noreferrer" aria-describedby="open-in-new-window">Cookie Policy</a>.</p>
            AuthModal
        </div>
    )
}
export default AuthModal
